import sys

def main():
    n = int(input())
    f = list(map(int, input().split()))
    assert len(f) == n
    assert all(0 <= x <= n for x in f)
    assert all(x != i for i, x in enumerate(f))
    assert all(x != 0 for x in f)
    assert len(set(f)) == n - 1

    for i in range(n):
        if f[i] == 0:
            for j in range(1, n + 1):
                if j not in f and j != i:
                    f[i] = j
                    break

    print(*f)

if __name__ == '__main__':
    main()

